import React from 'react';
import {Link} from 'react-router-dom'

function LinkFavorites (props) {
  console.log(props.menuNavigationFavorites)
  return (
    <div
      className={props.menuNavigationFavorites ? "linkLayout linkLayout--active" : "linkLayout"}
      checked={props.menuNavigationFavorites}
      onClick={props.changeFavorites}
    >
      <Link
        to="/Favorites"
        className="link"
      >
        Избранное
      </Link>
    </div>
  )
}

export default LinkFavorites
